'use strict';
let MessageType = require('./MessageType.js');
let RolloverProfilesList = require('./RolloverProfilesList.js');
class GetRolloverProfilesMessage {
    rolloverProfilesList;
    accountId;
    constructor() {
        this.rolloverProfilesList = new RolloverProfilesList();
    }
    getRolloverProfiles() {
        return this.rolloverProfilesList.toArray();
    }
    getType() {
        return MessageType.GetRolloverProfiles;
    }
    getAccountId() {
        return this.accountId;
    }
}
module.exports = GetRolloverProfilesMessage
